A plugin is a trait that is implemented for any runtime. So when you want to use the plugin you can add a constraint on the Runtime: # extern crate rock_n_rollup;
use rock_n_rollup::core::Runtime;
use rock_n_rollup::plugins::logger::Logger; fn transition<R: Runtime + Logger>(rt: &mut R) { rt.log("Hello kernel");
}
# fn main() {} If you don't care of the Runtime, you can restrict your function to your plugin and only your plugin: # extern crate rock_n_rollup;
use rock_n_rollup::plugins::logger::Logger; fn transition<R: Logger>(rt: &mut R) { rt.log("Hello kernel");
}
# fn main() {} And of course, you can compose plugins with each other # extern crate rock_n_rollup;
use rock_n_rollup::plugins::logger::Logger;
use rock_n_rollup::plugins::hasher::Hasher; fn transition<R: Logger + Hasher>(rt: &mut R) { let data = "Hello world"; rt.info("Hello world"); let hash = rt.hash(data.as_bytes());
}
# fn main() {} Unfortunately there is one limitation, it's complicated to use two plugins that exposes the same feature.
